import React from 'react';

export default function TopBar() {
  return (
    <div className="p-3 bg-customBlue ">
      <div className="flex items-center justify-center font-medium text-white">
        <i class="fa fa-briefcase mr-2" aria-hidden="true"></i>
        <p>Looking for hire developers?</p>
        <a className="pl-1 underline" href="#mmm">
          Visit our Hiring Platform
        </a>
      </div>
    </div>
  );
}
